function code(){const e=new URL(window.location.href);return e.pathname.substring(e.pathname.lastIndexOf('/')+1,e.pathname.lastIndexOf('.'))}function link(){return`https://jake.harvanchik.me/case/?p=${code()}`}function copied(){const e=document.querySelector('button');e.classList.contains('!bg-green-500')||(e.classList.add('!bg-green-500','scale-105'),setTimeout(()=>{e.classList.remove('!bg-green-500','scale-105')},1e3))}function highlight(e){for(var t=document.querySelectorAll(e),n=0;n<t.length;n++){var a=t[n].textContent;if(a){a=(a=a.replace(/\(([a-z])\)/gi,function(e,t){var n=document.createElement('mark');return'a'===t?n.setAttribute('green',!0):'b'===t?n.setAttribute('blue',!0):'c'===t?n.setAttribute('orange',!0):'d'===t?n.setAttribute('indigo',!0):'e'===t&&n.setAttribute('red',!0),n.textContent=`(${t})`,n.outerHTML})).replace(/Team ([A-Z])/gi,function(e,t){var n=document.createElement('team');return n.textContent=`Team ${t}`,n.outerHTML}),t[n].innerHTML=a}}}async function getCasePlays(){const e=window.location.href.includes('localhost')?'/case/':`${window.location.origin}/flag-football-case-plays/case/`;console.log(window.location.href),console.log(e);const t=await fetch(e);return(await t.text()).match(/href="([^"]*\.html)/g).map(e=>e.substring(6).replace('.html','').replace('/case/',''))}document.title=`Case Play ${code()}`,highlight('p'),highlight('span');